import './App.css';
import Navbar from "./Navbar"

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Navbar />
      </header>
      <body>
        <h1>Path of Umbria</h1>
      </body>
      <footer>
        <p>Page's footer</p>
      </footer>
    </div>
  );
}

export default App;
